import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../welcome/Welcome.css";
import { Link  } from "react-router-dom";
import slick1 from "../images/spotlight-pregnancy-symptoms-2021.png";
import babyname from "../images/spotlight-pregnancy-symptoms-2021.png";
import ovulation from "../images/ovulation-calcutor.png";
import growth from "../images/Height-and-weight-chart_3x.png.pagespeed.ce.UaksTMzqRr.png";
import duedate from "../images/duedate.png";


export default class MultipleItems extends Component {
    render() {
      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
      };
      return (

        // <div className="container">

        <div id="carouselExampleInterval" class="carousel slide" data-bs-ride="carousel">
  <div class="carousel-inner">
    <div class="carousel-item active" data-bs-interval="10000">
      <img src={slick1} class="d-block w-100" alt="..."/>
    </div>
    <div class="carousel-item" data-bs-interval="2000">
      <img src={slick1} class="d-block w-100" alt="..."/>
    </div>
    <div class="carousel-item">
      <img src={slick1} class="d-block w-100" alt="..."/>
    </div>
  </div>
  <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Previous</span>
  </button>
  <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Next</span>
  </button>
</div>





      );
    }
  }
